class Stack:
    def __init__(self):
        self.__list = []

    def push(self, item):
        self.__list.append(item)

    def top(self):
        # return the item on the top of the stack without popping it off
        return self.__list[-1]

    def pop(self):
        return self.__list.pop()

    def clear(self):
        self.__list = []

    def isEmpty(self):
        return len(self.__list) == 0

    def __len__(self):
        return len(self.__list)
